  let [name,setName]=useState('Ricky')
  let change=()=>{
   setName('rishi')
  }

  return (
    <div>
      <button className='btn btn-primary m-5' onClick={change}>Click here</button>
      <h1>{name}</h1>
    </div>
  );
}

export default App;
